import React from "react";
import "./about.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Image from "react-bootstrap/Image";
import pirates from "../../images/pirates.jpg";

const about = () => (
  <div className="about">
    <div id={"about"}></div>
    <p className="pageTitle">About me</p>
    <div className="aboutContent">
      <p>
        Hi there! My name is Irene van Dijk and this is my website. Here I showcase one of my favorite hobbies: making macram&#233; plant holders. I named my brand Irene Arr, {" "}
      </p>
      <Image className="imageRound" src={pirates} roundedCircle fluid />
    </div>
  </div>
);

export default about;
